Application.ScrollMagic.Scenes.Life=function(){const TIMELINE_MAIN=(new TimelineMax).fromTo("#my-life-text",100,{y:0,x:"-250%"},{y:0,x:"150%"},0);for(const[index,element]of Object.entries(document.querySelectorAll(".lifeline-card"))){const TIMELINE=new TimelineMax,ID=$(element).attr("id");/Android|webOS|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini/i.test(navigator.userAgent)?TIMELINE.fromTo(`#${ID} .lifeline-text`,1,{opacity:.05,y:"10%",scale:.96},{opacity:1,y:"0%",scale:1},.3):TIMELINE.fromTo(`#${ID} .lifeline-text`,1,{opacity:.05,y:"30%",scale:.96},{opacity:1,y:"50%",scale:1},.3).fromTo(`#${ID} .lifeline-image`,3,{opacity:.05,y:"15%"},{opacity:1,y:"40%"},0),Application.Layout.set(`Life#${ID}`,new ScrollMagic.Scene({triggerElement:`#${ID}`,triggerHook:.8,duration:"80%"}).setTween(TIMELINE).addTo(Application.ScrollMagic.Controllers.Main))}return Application.Layout.set("LifeText",new ScrollMagic.Scene({triggerElement:"#my-life-text",triggerHook:1,duration:"200%"}).setTween(TIMELINE_MAIN).addTo(Application.ScrollMagic.Controllers.Main)),!0};